import React from 'react';
import {Form,Button,Col} from 'react-bootstrap';


function roles (){
    return(

        <div class="container-fluid">
            
        <section id= "bgc">
        <Col md={8} >
        <Form.Group as={Col} controlId="formGridEmail">
            <Form.Label>Role Name</Form.Label>
            <Form.Control type="name" placeholder="Enter Role Name" />
            <Form.Text className="text-muted">
            </Form.Text>
           
          </Form.Group>
         

          <div class="text-center">

            <Button  href="/authority" variant="light" type=" button ">Set Authority</Button> {' '}
          
            <Button variant="info" type=" save "> save </Button>{' '}
          
            <Button variant="warning" type=" cancel " >cancel</Button>

          </div>
          </Col>
           
            </section>
        </div>
    
    );
}

export default roles;
